import { Link, Router } from "react-router-dom";

const Navbar = (props) => {
  return (
    <div className="nav-main">
    <ul>
        <li><Link className="nav" to="/">
          Home
        </Link></li>
        <li></li><Link className="nav" to="/results">
          All Products
        </Link>
        <Link className="nav" to="/cart">
          My Cart
        </Link>
        <Link className="nav" to="/myorder">
          My Order
        </Link>
      </ul>
    </div>
  );
};

export default Navbar;
